actionConfiguration.body:
() => {
  const mutable = Customers.mutableConfig();
  const originals = Customers.selectedCustomer()?.configs;
  if (!mutable || !originals) {
    return false;
  }
  return originals.some(config => !Customers.compareConfigs(mutable, config));
}

